import React from 'react';
import SeeMoreButton from './SeeMoreButton';
import './whatHappened.css';

function WhatHappened() {
  return (
    <div className='what-happened__container'>
      <h3 className='what-happened__title'>What Happened</h3>
      <p className='what-happened__subtitle'>
        How to create mobile-optimized videos in minutes. Not a designer, every
        team makes a lot of videos Can be trimmed. Take the first{' '}
      </p>
      <SeeMoreButton />
      <img src='img/video.png' alt='video' />
    </div>
  );
}

export default WhatHappened;
